The tweet that uses a Distort tactic is:

@PierrePoilievre Says the man who illegally accepted over $18K in "free travel" from Chinese sponsors... ü§î #CdnPoli #CPC #CPCNonsense #PierrePoilievreIsLyingToYou #PierrePoilievreMustGo #PeePeeMustGo #PierrePoilievreIsBroken https://t.co/oEqPgw38qa

This tweet is trying to shift the focus away from the topic of Chinese interference and instead focuses on a personal attack against Pierre Poilievre. It distorts the main message by bringing up unrelated allegations.
